INSERT INTO `drive_templates` (`drive_template_id`, `drive_template_sequence_order`, `drive_template_organization_id`, `drive_template_duration`, `drive_template_notes`, `drive_template_description`) VALUES
(1, 1, 3, 0.75, '', 'Parking lot and light residential'),
(2, 2, 3, 0.75, '', 'More parking lot and light residential'),
(3, 3, 3, 0.75, '', 'Light residential/Suburban surface'),
(4, 4, 3, 0.75, '', 'Suburban surface and rural roads'),
(5, 5, 3, 0.75, '', 'Parking lot and main arterials'),
(6, 6, 3, 0.75, '', 'Main arterials and rural roads'),
(7, 7, 3, 0.75, '', 'Parking lot, residential, arterials'),
(8, 8, 3, 0.75, '', 'Freeways'),
(9, 1, 1, 1, 'A description of the drive objectives here.', 'Basic driving skills'),
(10, 2, 1, 1, '', 'Out on the street'),
(11, 3, 1, 1, '', 'Driving in traffic'),
(12, 4, 1, 1, '', 'Judging the drive path'),
(13, 5, 1, 1, '', 'Freeway skills'),
(14, 1, 2, 1, '<h3>Smooth Acceleration</h3><ul><li>Let vehicle "walk"</li><li>Heel pivot to accelerator</li><li>"Press" lightly, don\'t "push" or "shove"</li></ul><h3>Smooth Stopping</h3><ul><li>Steady, even pressure</li><li>Feel the "recoil" of the complete stop</li></ul><h3>Standard Reference Points</h3><ul><li>Right side reference (parking to the right and position 3)&mdash;middle of the hood</li><li>Left side reference (parking on the left, lane position 2, left turn lane)&mdash;1 foot inside left corner of hood</li><li>Front limit reference (stopping before crosswalks, stop lines, safety stops)&mdash;left/right corner posts or side mirrors</li><li>Rear limit reference point (rear point of parking space)&mdash;one foot behind corner post or middle of rear side window</li><li>Center lane position&mdash;optical illusion of steering wheel centered between center and side lane markings</li><li>Right side three foot reference (right-hand turns)&mdash;midway of right half of hood</li></ul><h3>Steering</h3><ul><li>Balanced hand position of 9-3, or 8-4</li><li>Hand-over-hand for sharp turns</li><li>Push-pull for routine turns and curves</li></ul>', 'Basic driving skills'),
(15, 2, 2, 1, '<h3>MSMOG</h3><ul><li>Mirror, Signal, Mirror, Over-the-shoulder, Go if safe</li><li>Chin to shoulder</li><li>At every lane change (even into left and right turn only lanes)</li></ul><h3>LOS/POT Checks</h3><ul><li>Scan intersections carefully while approaching</li><li>Use SIPDE (scan, identify, predict, decide, execute)</li><li>Make speed/direction decision for POT hazards</li><li>Adjust position to compensate for LOS obstructions</li><li>Minimize or separate hazards, compromise space, if necessary</li><li>Respect bike lanes and riders</li></ul><br /><h3>Obey Speed Limit</h3><br /><h3>Backing</h3><ul><li>Steer with your left hand only if backing up in a straight line</li><li>Turn the steering wheeling in the direction you want the back end to go</li><li>Keep maneuvers small so that you don\'t overcorrect</li></ul><h3>Turnabouts</h3><ul><li>Safest&mdash;pull beyond right-hand driveway and back in</li><li>Next safest&mdash;Headfirst into left-hand driveway&mdash;backing tightly into own lane</li><li>Head in on the right&mdash;pull across first lane before turning into proper lane</li><li>U-turn is legal in intersections only and with 500\' clear vision all ways</li><li>Most dangerous is 3-point turnabout&mdash;used when no driveways are available</li><li>MAKE SURE TO CHECK ALL ZONES AT EACH POINT IN TURNABOUT</li></ul>', 'Out on the street'),
(16, 3, 2, 1, '<h4>This is the most important drive of the BTW course. You will spend most of your driving life in city traffic.</h4><br /><h3>Basic Defensive Driving Techniques</h3><ul><li>Act as though you are invisible!</li><li>Expect other drivers to ignore traffic signals</li><li>Cover the brake and check back, left, front, and right before entering intersections</li><li>Scan constantly&mdash;especially your rearview mirror</li><li>Create a "space cushion" around your car for an escape route</li><li>Look ahead of the vehicle ahead of you whenever possible</li><li>Maintain a 3 second following distance&mdash;more, of conditions require it</li></ul><br /><h3>Yellow Lights</h3><ul><li>Glance to you rearview mirror first for tailgaters</li><li>Continue through the light once you are past your point of no return</li></ul><br /><h3>Green Lights</h3><ul><li>When light changes, look left and right to check for stragglers</li><li>Time green lights for smooth travel and fuel savings</li></ul><br /><h3>One-way and Two-way Streets</h3><ul><li>Scan for one-way signs posted at corners and along streets</li><li>Dividing lines are white, showing traffic moving in one direction in one-ways</li><li>Dividing line is yellow to show two-way traffic</li><li>Look for traffic traveling or parking in one or two directions</li><li>Remember to turn into the nearest lane going in your direction (except channel lanes, which have pavement markings)</li></ul>', 'Driving in traffic'),
(17, 4, 2, 1, '<h3>Forward Perpendicular Parking</h3><ul><li>Position your vehicle as far opposite the intended stall as possible</li><li>Signal your turn</li><li>Drive slowly forward until the appropriate side view mirror is even with the first line of the stall</li><li>Turn wheel sharply into the stall and correct steering to center</li><li>When backing from stall wait until the read end of the neighboring vehicle is even with your windshield</li><br /><h3>Curves</h3><ul><li>Get information&mdash;four seconds of roadway ahead</li><li>Check all zones for LOS/POT issues</li><li>Consider the arc of the curve</li><li>Adjust speed for curve. If you can\'t see 4 seconds ahead, YOU\'RE GOING TOO FAST!</li><li>Plan and correct your drive path to maximize traction and safety</li></ul><br /><h3>Hills</h3><ul><li>Determine LOS/POT issues and zones as you approach crest</li><li>At crest, quickly reassess zones to make necessary corrections</li></ul><br /><h3>Being Passed</h3><ul><li>Be aware of vehicles in your rear zone</li><li>Be prepared for being passed</li><li>Pull as far to the right as you safely can</li><li>Take foot off the accelerator to slow slightly and facilitate the passing/return of vehicle</li><li>Accelerate smoothly to previous road speed</li></ul>', 'Judging the drive path'),
(18, 5, 2, 1, '<h3>Entrance Ramp</h3><ul><li>Signal as you enter the gore area</li><li>Search for a gap</li><li>Accelerate to approximate moving traffic</li><li>Do not slow in the merge area unless a hazard occurs</i><li>Stay in the far right lane until your travel speed and place are established</li><li>Remember, you must yield to traffic already on the freeway</li></ul><br /><h3>Freeway Travel</h3><ul><li>Maintain a "high visual horizon" by looking beyond the card ahead to the horizon</li><Li>Try to maintain a space cushion around your car&mdash;don\'t travel side by side with other vehicles</li><li>Check rearview every 7-10 seconds. Be aware of all open zones.</li><li>Maintain a minimum following distance of 4 seconds&mdash;if you can read the license plate of the card ahead of you at 55 mph, you are too close!</li><li>MSMOG for all lane changes&mdash;do not slow after lane change</li><li>Be aware of entering traffic. Facilitate their entrance by maintaining a constant speed in your lane or moving to the lane of least resistance</li><li>When passing a large truck or being passed by one, be aware of their NO ZONES</li><li>Be cautious around cars on the shoulder. Look for the reason for them to be there and give them room</li><li>Pull completely off the freeway onto the shoulder if you must stop on the freeway</li></ul><br /><h3>Exit Ramp</h3><ul><li>Signal well in advance of the exit</li><li>Do not slow down until you are off the freeway and in the deceleration lane</li><li>Slow down to the posted speed before the exit curve, then accelerate very gradually around the curve</li><li>Watch for stop signs at the end of the exit</li><li>Don\'t become "velocitated." Be aware that it is difficult to come down off of highway speeds</li></ul>', 'Freeway skills');
